/** @jsxImportSource @emotion/react */
import React from "react";
import { css } from "@emotion/react";
import { Button, Cell, Grid, TextField, VFlow } from "bold-ui";

export function FormLogin() {
  return (
    <Grid
      alignItems="center"
      direction="row"
      gap={2}
      gapVertical={1}
      justifyContent="flex-end"
    >
      <Cell lg={12} md={12} sm={12} xs={12}>
        <TextField label="Usuário" placeholder="CPF" required />
      </Cell>
      <Cell lg={12} md={12} sm={12} xs={12}>
        <TextField label="Senha" placeholder="Senha" type="password" required />
      </Cell>
      <Cell lg={6} md={6} sm={6} xs={6}>
        <Button kind="primary" size="medium">
          Entrar
        </Button>
      </Cell>
    </Grid>
  );
}

const containerStyles = css`
  width: 100%;
`;
